const Calculator = () => {
  const style = {
    //Now working
    backgroundImage: `url(${background})`,
    height: "100vh",
    backgroundSize: "cover",
}
  return (
    <div style={style}>
      <h2 style={{paddingTop:"120px", paddingLeft:"850px"}}>Estimate the Emissions of a Company!</h2>
      <h5 style={{paddingLeft:"400px", paddingTop:"100px"}}>First, more about the company:</h5>
      <form>
        <input type="text" id="companyname" placeholder='Company Name:'></input>
        <input type="number" id="Revenue" placeholder='2021 Revenue:'></input>
        <input type="number" id="companyname" placeholder='2021 Energy Consumption'></input>
      </form>
    </div>

  )
}

export default Calculator
